/*Table structure for table `appoint` */

DROP TABLE IF EXISTS `appoint`;

CREATE TABLE `appoint` (
  `id` bigint(20) unsigned NOT NULL COMMENT 'id',
  `need_id` bigint(20) unsigned DEFAULT NULL COMMENT '需求id_外键',
  `student_id` bigint(20) DEFAULT NULL COMMENT '家长id_外键(用户id)',
  `teacher_id` bigint(20) unsigned DEFAULT NULL COMMENT '老师id_外键(用户id)',
  `trade_no` varchar(255) DEFAULT NULL COMMENT '订单号',
  `student_comment_state` tinyint(4) DEFAULT '0' COMMENT '学生是否已评论 0未评论 1已评论',
