  `student_delete_state` tinyint(4) DEFAULT '0' COMMENT '学生是否已软删除 0未删除 1已删除',
  `teacher_delete_state` tinyint(4) DEFAULT '0' COMMENT '老师是否已软删除 0未删除 1已删除',
  `state` tinyint(4) DEFAULT NULL COMMENT '状态 1已预约 2待付款 已中标 3试教中 4进行中 5待结课 6待关闭 7待评论 8已完成 9已维权 10已关闭',
  `reason` varchar(255) DEFAULT NULL COMMENT '关闭原因',
  `weight` bigint(20) DEFAULT '0' COMMENT '排序',
  `status` tinyint(4) DEFAULT '1' COMMENT '状态 0禁用 1启用',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `frequency` bigint(20) DEFAULT NULL COMMENT '总共几次',
  `time_hour` bigint(20) DEFAULT NULL COMMENT '每次几小时',
  `hour_price` decimal(10,2) DEFAULT NULL COMMENT '每小时几元',
  `total_price` decimal(10,2) DEFAULT NULL COMMENT '老师报价',
  `nickname` varchar(255) DEFAULT NULL COMMENT '称呼',
  `phone` varchar(255) DEFAULT NULL COMMENT '联系手机号',
  `wechat` varchar(255) DEFAULT NULL COMMENT '微信',
  `qq` varchar(255) DEFAULT NULL COMMENT 'QQ',
  `address` varchar(255) DEFAULT NULL COMMENT '详细地址',
  `subject` varchar(255) DEFAULT NULL COMMENT '科目',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='老师预约表';

