/*Table structure for table `comment` */

DROP TABLE IF EXISTS `comment`;

CREATE TABLE `comment` (
  `id` bigint(20) unsigned NOT NULL COMMENT 'ID',
  `from_id` bigint(20) DEFAULT NULL COMMENT '学生id_外键(用户) 评论人',
  `to_id` bigint(20) DEFAULT NULL COMMENT '老师id_外键(用户) 评论给谁',
  `need_id` bigint(20) DEFAULT NULL COMMENT '需求id_外键 评论给哪个需求',
  `parent_id` bigint(20) DEFAULT '0' COMMENT '父id_外键 预留',
  `appoint_id` bigint(20) DEFAULT NULL COMMENT '预约id_外键',
  `content` varchar(255) DEFAULT NULL COMMENT '评论内容',
  `type` tinyint(4) DEFAULT '1' COMMENT '类型 1好评 2中评 3差评',
  `rank` tinyint(4) unsigned zerofill DEFAULT NULL COMMENT '评分等级 1-5',
  `title` varchar(255) DEFAULT NULL COMMENT '评分标题 预留',
  `tag` varchar(255) DEFAULT NULL COMMENT '标签 空格隔开 预留',
  `status` tinyint(4) DEFAULT '1' COMMENT '状态 0禁用 1启用',
  `weight` bigint(20) DEFAULT '0' COMMENT '排序',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

