/*Table structure for table `realname_auth` */

DROP TABLE IF EXISTS `realname_auth`;

CREATE TABLE `realname_auth` (
  `id` bigint(20) unsigned NOT NULL COMMENT 'id',
  `realname` varchar(255) DEFAULT NULL COMMENT '真实姓名',
  `id_number` varchar(255) DEFAULT NULL COMMENT '身份证号',
  `image1` varchar(255) DEFAULT NULL COMMENT '身份证正面图片',
  `image2` varchar(255) DEFAULT NULL COMMENT '身份证反面图片',
  `teacher_id` bigint(20) unsigned DEFAULT NULL COMMENT '老师id_外键(用户)',
  `state` tinyint(4) DEFAULT '1' COMMENT '状态 1未审核, 2审核通过 3审核不通过',
  `reason` varchar(255) DEFAULT NULL COMMENT '审核失败原因',
  `weight` bigint(20) DEFAULT '0' COMMENT '排序',
  `status` tinyint(4) DEFAULT '1' COMMENT '状态 0禁用 1启用',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='实名认证';

