/*Table structure for table `teacher` */

DROP TABLE IF EXISTS `teacher`;

CREATE TABLE `teacher` (
  `id` bigint(20) unsigned NOT NULL COMMENT 'id',
  `user_id` bigint(20) DEFAULT NULL COMMENT '用户id_外键',
  `total_success` bigint(20) DEFAULT '0' COMMENT '成功次数',
  `total_comment` bigint(20) DEFAULT '0' COMMENT '评论条数',
  `experience` bigint(20) DEFAULT '0' COMMENT '教学经验(年)',
  `age` bigint(20) DEFAULT NULL COMMENT '年龄',
  `nickname` varchar(255) DEFAULT NULL COMMENT '昵称',
  `realname` varchar(255) DEFAULT NULL COMMENT '真实姓名',
  `good_at` varchar(255) DEFAULT NULL COMMENT '擅长科目',
  `resume` varchar(255) DEFAULT NULL COMMENT '个人简介',
  `qq` varchar(255) DEFAULT NULL COMMENT 'QQ号',
  `wechat` varchar(255) DEFAULT NULL COMMENT '微信号',
  `email` varchar(255) DEFAULT NULL COMMENT '邮箱号',
  `phone` varchar(255) DEFAULT NULL COMMENT '电话',
  `address` varchar(255) DEFAULT NULL COMMENT '居住地址',
  `current_job` varchar(255) DEFAULT NULL COMMENT '当前工作',
  `head_image` varchar(255) DEFAULT NULL COMMENT '头像地址',
  `gender` tinyint(4) DEFAULT NULL COMMENT '性别 1男 2女',
  `state` tinyint(4) DEFAULT '1' COMMENT '审核状态 //1已提交 2审核不通过 3审核通过',
  `satisfaction` decimal(10,2) DEFAULT '0.00' COMMENT '满意度1-100, 自动计算',
  `hour_price` decimal(10,2) DEFAULT '0.00' COMMENT '课时费用',
  `balance` decimal(10,2) DEFAULT '0.00' COMMENT '我的余额',
  `province_id` bigint(20) DEFAULT '21' COMMENT '所在省份_外键',
  `city_id` bigint(20) DEFAULT '162' COMMENT '所在城市_外键',
  `teach_date` text COMMENT '授课时间',
  `realname_auth` tinyint(4) DEFAULT '0' COMMENT '是否实名认证 0否 1是',
  `student_auth` tinyint(4) DEFAULT '0' COMMENT '是否大学生认证 0否 1是',
  `teacher_auth` tinyint(4) DEFAULT '0' COMMENT '是否在职教师认证 0否 1是',
  `reason` varchar(255) DEFAULT NULL COMMENT '失败原因',
  `last_login_time` datetime DEFAULT NULL COMMENT '最近登录',
  `weight` bigint(20) DEFAULT '0' COMMENT '排序',
  `status` tinyint(4) DEFAULT '1' COMMENT '状态 0禁用 1启用',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='教员表';

