/*Table structure for table `teacher_area_relation` */

DROP TABLE IF EXISTS `teacher_area_relation`;

CREATE TABLE `teacher_area_relation` (
  `id` bigint(20) unsigned NOT NULL COMMENT 'id',
  `teacher_id` bigint(20) unsigned NOT NULL COMMENT '教师id_外键',
  `area_id` bigint(20) unsigned DEFAULT NULL COMMENT '地区id_外键',
  `weight` bigint(20) DEFAULT '0' COMMENT '排序',
  `status` tinyint(4) DEFAULT '1' COMMENT '状态 0禁用 1启用',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
